import React, { useState } from 'react';
import { useForm } from 'react-hook-form';
import './styles/BookingForm.css'; // Import the corresponding CSS file

const BookingForm = () => {
  const { register, handleSubmit, formState: { errors } } = useForm();
  const [formSubmitted, setFormSubmitted] = useState(false);

  // Function to handle form submission
  const onSubmit = (data) => {
    setFormSubmitted(true);
    console.log(data);
    // Handle the form submission, e.g., send data to an API
  };

  return (
    <div className="booking-form-container">
      <h2>Car Rescue Booking</h2>
      <form onSubmit={handleSubmit(onSubmit)} className="booking-form">
        {/* Car Registration Number */}
        <div className="form-group">
          <label>Car Registration Number</label>
          <input 
            type="text" 
            {...register("carRegistration", { required: "Car registration number is required" })}
          />
          {errors.carRegistration && <p className="error">{errors.carRegistration.message}</p>}
        </div>

        {/* Car Type */}
        <div className="form-group">
          <label>Car Type</label>
          <input 
            type="text" 
            {...register("carType", { required: "Car type is required" })}
          />
          {errors.carType && <p className="error">{errors.carType.message}</p>}
        </div>

        {/* Car Weight */}
        <div className="form-group">
          <label>Car Weight</label>
          <input 
            type="number" 
            {...register("carWeight", { required: "Car weight is required", min: 1 })}
          />
          {errors.carWeight && <p className="error">{errors.carWeight.message}</p>}
        </div>

        {/* Pickup Location */}
        <div className="form-group">
          <label>Pickup Location</label>
          <input 
            type="text" 
            {...register("pickupLocation", { required: "Pickup location is required" })}
          />
          {errors.pickupLocation && <p className="error">{errors.pickupLocation.message}</p>}
        </div>

        {/* Delivery Location */}
        <div className="form-group">
          <label>Delivery Location</label>
          <input 
            type="text" 
            {...register("deliveryLocation", { required: "Delivery location is required" })}
          />
          {errors.deliveryLocation && <p className="error">{errors.deliveryLocation.message}</p>}
        </div>

        {/* Your Name */}
        <div className="form-group">
          <label>Your Name</label>
          <input 
            type="text" 
            {...register("userName", { required: "Your name is required" })}
          />
          {errors.userName && <p className="error">{errors.userName.message}</p>}
        </div>

        {/* Your Phone Number */}
        <div className="form-group">
          <label>Your Phone Number</label>
          <input 
            type="tel" 
            {...register("userPhone", { required: "Your phone number is required" })}
          />
          {errors.userPhone && <p className="error">{errors.userPhone.message}</p>}
        </div>

        {/* Terms and Conditions Checkbox */}
        <div className="form-group">
          <input 
            type="checkbox" 
            {...register("termsAccepted", { required: "You must accept the terms and conditions" })} 
          />
          <label>
            I agree to the 
            <a href="/terms" target="_blank" rel="noopener noreferrer"> Terms and Conditions</a>
          </label>
          {errors.termsAccepted && <p className="error">{errors.termsAccepted.message}</p>}
        </div>

        {/* Payment Information */}
        <div className="payment-info">
          <p>Payment of KES 1,500 is required to complete the booking.</p>
          <a href="https://paystack.com/pay/hire-a-flatbed" target="_blank" rel="noopener noreferrer">
            Pay Now
          </a>
        </div>

        {/* Submit Button */}
        <button type="submit" className="submit-button">Complete Booking</button>
      </form>

      {/* Success Message */}
      {formSubmitted && <p className="success-message">Booking submitted successfully!</p>}
    </div>
  );
};

export default BookingForm;
